import { defineStore } from "pinia";
import { apiLibreta } from "boot/axios";
import { apiOficialia } from "boot/axios";
import { Validaciones } from "src/helpers/validaciones";
import { Cuaderno } from "src/data/cuaderno";
export const useLibretaStore = defineStore("libreta", {
  getters: {
    totalPromociones() {
      return this.data?.totalRegistros;
    },
  },
  state: () => ({
    cuadernos: Array(new Cuaderno()),
  }),
  actions: {
    /**
     * obtiene las promociones
     * @param {*} params object {
     * from: date,
     * to: date,
     * status: 0,
     * text: '',
     * sortBy: 'prop',
     * descending: true,
     * page:1,
     * rowsPerPage:0
     * }
     */
    async obtenerLibreta(params) {
      this.listaLibreta = Object.assign([], []);
      this.data = await apiLibreta.get(
        "api/libretaOficio/ObtenerLibretaOficio",
        {
          params: {
            fechaInicial: params.from,
            fechaFinal: params.to,
            registrosPorPagina: params.page,
            pagina: params.rowsPerPage, //este va ir en 0 cuando sea todos
          },
        },
      );
    },
    async obtenerPromociones(params) {
      this.listaPromociones = Object.assign([], []);
      this.data = (
        await apiLibreta.get("api/promociones/", {
          params: {
            fechaInicial: params.from,
            fechaFinal: params.to,
            estado: params.status,
            //parametros paginacion
            texto: params.text?.trim() || "",
            ordenarPor: params.sortBy,
            descendente: params.descending,
            registrosPorPagina: params.page,
            pagina: params.rowsPerPage, //este va ir en 0 cuando sea todos
          },
        })
      )?.data;
    },
    /**
     *obtine expediente de promocion pdf
     * @param {*} id es asuntoNeunId
     */
    async obtenerExpediente(
      asuntoNeunId,
      numeroRegistro,
      numeroOrder,
      anioPromocion,
    ) {
      this.expedientePdf = "";
      this.expedientePdf = (
        await apiLibreta.get(`api/promociones/expediente/`, {
          params: { asuntoNeunId, numeroRegistro, numeroOrder, anioPromocion },
        })
      )?.data?.base64;
    },

    /**
     *obtine expediente de promocion pdf
     * @param {*} asuntoNeunId es asuntoNeunId
     */
    async obtenerArchivosYAnexos(
      asuntoNeunId,
      anioPromocion,
      numeroOrden,
      tipoModulo,
      AsuntoDocumentoId,
      origen,
    ) {
      const res = await apiLibreta.get("api/promociones/archivos", {
        params: {
          asuntoNeunId: asuntoNeunId,
          anioPromocion: anioPromocion,
          numeroOrden: numeroOrden,
          tipoModulo: tipoModulo,
          AsuntoDocumentoId: AsuntoDocumentoId,
          origen: origen,
        },
      });
      this.archivos = res.data;
    },
    /**
     * Calcula el numero de registro consecutivo
     */
    // async calculaRegistro () {
    //   this.noRegistro = 1;
    //   this.noRegistro = (
    //     await apiLibreta.get("api/registro", {
    //       params: {},
    //     })
    //   )?.data?.registro;
    // },
    /**
     * Crea promocion
     * @param {*} params objecto promocion
     */
    async crearPromocion(params) {
      this.asuntoNeunId = 0;
      const resultado = (await apiLibreta.post("api/promociones", params)).data;
      this.asuntoNeunId = resultado?.asuntoNeunId;
      this.numeroOrden = resultado?.numeroOrden;
    },
    /**
     * Edita promocion
     * @param {*} params objecto promocion
     */
    async editarPromocion(params) {
      await apiLibreta.put("api/promociones", params);
    },
    /**
     * Busca expediente
     * @param {*} asuntoAlias numero expediente
     */
    async buscarExpediente(
      asuntoAlias,
      tipoAsuntoId,
      tipoProcedimiento = null,
      modulo = 1,
    ) {
      this.expediente = Object.assign([], []);
      const valid = Validaciones.validaNoExpediente(asuntoAlias);
      if (typeof valid === "string") {
        return;
      }
      this.expediente = (
        await apiOficialia.get("api/asociarexpediente", {
          params: {
            asuntoAlias: asuntoAlias,
            catTipoAsuntoId: tipoAsuntoId,
            catTipoProcedimiento: tipoProcedimiento,
            modulo: modulo,
          },
        })
      )?.data;
      if (this.expediente?.length > 0) {
        this.expediente = this.expediente.map((x) => {
          x.label = `${x.asuntoAlias} (${x.tipoAsunto})`;
          return x;
        });
      }
    },
    /**
     * Subir archivos
     * @param {*} params form data
     */
    async subirArchivo(params) {
      await apiLibreta.post("api/promociones/archivo", params, {
        headers: { "Content-Type": "multipart/form-data" },
      });
    },
    /**
     * Subir archivos
     * @param {*} params form data
     */
    async subirArchivos(params) {
      let resultado = [];
      resultado = (
        await apiLibreta.post("api/promociones/archivos", params, {
          headers: { "Content-Type": "multipart/form-data" },
        })
      ).data;
      return resultado;
    },
    /**
     * Subir anexos
     * @param {*} params objecto anexos
     */
    async subirAnexos(params) {
      let anexos = [];
      anexos = (
        await apiLibreta.post("api/promociones/anexos", params, {
          headers: { "Content-Type": "multipart/form-data" },
        })
      ).data;
      return anexos;
    },
    /**
     * Obtiene el detalle de la promocion
     * @param {*} parametros
     */
    async detallePromocion(parametros) {
      this.promocion = {};
      const response = (
        await apiLibreta.get("api/promociondetalle", {
          params: {
            ...parametros,
          },
        })
      )?.data.datos;
      if (response.length > 0) {
        this.promocion = response[0];
        this.promocion.anexos = JSON.parse(this.promocion.anexos);
      }
    },

    /**
     * Subir anexos
     * @param {*} ruta objecto anexos
     */
    async recuperarArchivo(ruta) {
      this.archivoBase64 = ruta;
      this.archivoBase64 =
        "";
      // this.archivoBase64 = (
      //   await apiLibreta.get("api/promociones/documento", {
      //     params: { ruta: ruta },
      //   })
      // )?.data?.base64;
      // console.log("Aca");
    },
    /**
     * Elimina la promocion
     * @param {*} parametros
     */
    eliminarAnexo(parametros) {
      return apiLibreta.delete("api/anexos", {
        data: {
          ...parametros,
        },
      });
    },
    /**
     * Asociar promocion
     * @param {*} params objecto promocion
     */
    async asociarPromocion(params) {
      this.numeroOrden = 0;
      this.numeroOrden = (
        await apiLibreta.post("api/promocionesinsertar", params)
      ).data;
    },
    /**
     * Promociones por expediente
     * @param {*} parametros objecto parametros
     */
    async promocionesPorExpediente(parametros) {
      this.promocionesXExpediente = [];
      this.promocionesXExpediente = (
        await apiLibreta.get("api/promocion/expediente", {
          params: parametros,
        })
      ).data;
    },
    // async revisarNumeroPromocion (parametros) {
    //   const promocionExiste = (
    //     await apiLibreta.get("api/promociones/estatus", {
    //       params: {
    //         NumeroRegistro: parametros.numeroPromocion,
    //         YearPromocion: parametros.anioPromocion,
    //       },
    //     })
    //   ).data;
    //   return promocionExiste.existe;
    // },
    async expedienteInsertarPromocion(parametros) {
      const promocionNueva = (
        await apiLibreta.post("api/expedientesinsertar", {
          catTipoAsuntoId: parametros.catTipoAsuntoId,
          numeroOCC: parametros.numeroOCC,
          noExpediente: parametros.noExpediente,
          tipoProcedimiento: parametros.tipoProcedimiento,
        })
      ).data;
      return promocionNueva;
    },

    /**
     * Cancela el oficio
     * @param {*} parametros
     */
    async cancelaOficio(params) {
      await apiLibreta.delete("api/libretaOficio/CancelarOficio", {
        data: {
          ...params,
        },
      });
    },
    async insertaOficio(params) {
      await apiLibreta.put("api/libretaOficio/InsertarOficio", {
        data: {
          ...params,
        },
      });
    },
  },
});
